$('.js-code-new').on('keyup',function(){

    $.ajax({
        type: "get",
        url: "/products/code_exists_check",
        data: {code:$(this).val()},
        success: function (response) {
            if(response.result == 1){
                $('input[name="code"]').addClass('is-invalid');
                $('.js-code-exist').show();
            }else{
                $('input[name="code"]').removeClass('is-invalid');
                $('.js-code-exist').hide(); 
            }
        }
    });
})

